import React, { useState } from 'react';
import './styleProducts.css';
const Products = () => {
    const [title, setTitle] = useState(['Id', 'Họ và tên', 'Tuổi', 'Email']);

    const [info, setInfo] = useState([
        {
            id: 1,
            name: 'Hồ Văn Thái',
            age: 25,
            email: 'thaiaren@gmail.com',
        },
        {
            id: 2,
            name: 'Nguyễn Văn A',
            age: 20,
            email: 'nguyenvana@gmail.com',
        },
        {
            id: 3,
            name: 'Phan Văn B',
            age: 23,
            email: 'phanvanb@gmail.com',
        },
        {
            id: 4,
            name: 'Đào Thi C',
            age: 25,
            email: 'daothic@gmail.com',
        },
    ]);
    const [newId, setNewId] = useState('');
    const [newName, setNewName] = useState('');
    const [newAge, setNewAge] = useState('');
    const [newEmail, setNewEmail] = useState('');
    const [edit, setEdit] = useState('');

    const onchangeId = (e) => {
        setNewId(e.currentTarget.value);
    };
    const onchangeName = (e) => {
        setNewName(e.currentTarget.value);
    };
    const onchangAge = (e) => {
        setNewAge(e.currentTarget.value);
    };
    const onchangeEmail = (e) => {
        setNewEmail(e.currentTarget.value);
    };
    console.log(newId);
    const onclickAdd = () => {
        const infoCopy = [...info];
        const indexId = infoCopy[infoCopy.length - 1].id;
        const countId = indexId + 1;
        infoCopy.push({
            id: countId,
            name: newName,
            age: newAge,
            email: newEmail,
        });
        setInfo(infoCopy);
        setNewId('');
        setNewName('');
        setNewAge('');
        setNewEmail('');
    };
    const onclickEdit = (e) => {
        setNewId(e.id);
        setNewName(e.name);
        setNewAge(e.age);
        setNewEmail(e.email);
        setEdit(e.id);
    };
    const onclickUpdata = () => {
        const infoCopy = [...info];
        const indexId = infoCopy.findIndex((index) => index.id === edit);
        infoCopy[indexId] = {
            id: newId,
            name: newName,
            age: newAge,
            email: newEmail,
        };
        setInfo(infoCopy);
        setNewId('');
        setNewName('');
        setNewAge('');
        setNewEmail('');
        setEdit('');
    };
    const onclickDelete = (id) => {
        const infoCopy = [...info];
        const indexId = infoCopy.findIndex((index) => index.id === id);
        infoCopy.splice(indexId, 1);
        setInfo(infoCopy);
    };
    return (
        <div className="container">
            <input
                type="number"
                onChange={onchangeId}
                placeholder="nhập Id"
                disabled
                value={newId}
            />
            <input
                type="text"
                onChange={onchangeName}
                placeholder=" nhập họ và tên"
                value={newName}
            />
            <input
                type="text"
                onChange={onchangAge}
                placeholder="nhập tuổi"
                value={newAge}
            />
            <input
                type="text"
                onChange={onchangeEmail}
                placeholder="nhập email"
                value={newEmail}
            />
            {edit ? (
                <button onClick={onclickUpdata}>cập nhật</button>
            ) : (
                <button onClick={onclickAdd}>thêm</button>
            )}

            <table className="table">
                <tr>
                    {title.map((item) => {
                        return <th>{item}</th>;
                    })}
                </tr>
                {info.map((item) => {
                    return (
                        <tr>
                            <td>{item.id}</td>
                            <td>{item.name}</td>
                            <td>{item.age}</td>
                            <td>{item.email}</td>
                            <td>
                                {' '}
                                <button onClick={() => onclickEdit(item)}>
                                    chỉnh sửa
                                </button>
                            </td>
                            <td>
                                {' '}
                                <button onClick={() => onclickDelete(item.id)}>
                                    xoá
                                </button>
                            </td>
                        </tr>
                    );
                })}
            </table>
        </div>
    );
};
export default Products;
